import React from "react"
import { ListItem, Card, CardActions, CardContent, Typography, Button } from "@material-ui/core";

class Item extends React.Component {
    constructor(props) {
        super(props);
        this.state = {item : props.item};
    }

    render() {
        const item = this.state.item;

        return (
            <Card  style = {{width:"20%", height:"25%", justifyContent : 'flex-start', margin : 16, padding : 16}} >
              <CardContent>

                <Typography variant="h5" component="div">
                  {item.title}
                </Typography>

                <Typography
                  sx={{ fontSize: 10 }}
                  color="text.secondary"
                  gutterBottom>
                      type : {item.type}
                </Typography>

                <Typography sx={{ mb: 1.5 }} color="text.secondary">
                    <br />
                  published by {item.userid}
                </Typography>

              </CardContent>

            </Card>
        );
    }
}

export default Item;
